    "The effect of water-level on utilization of short-grass marsh",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:19:49.630038",nt"name": "the-effect-of-water-level-on-utilization-of-short-grass-marsh",nt"isopen":
    false,nt"url": null,nt"notes": "The utilization of an area as a feeding
    ground is dependent on a number of factors. The type and amount of food is an obvious
    limiting factor on both the number of species and number of each species, likely
    to be present. Various physical factors (temperature, moisture, soil type, ect.)
    will effect the type and amount of food available. In a marsh area water becomes
    an important factor. A change in the water level will change the nature of the marsh
    which will effect the utilization of the marsh. If the water level is lowered, it
    will restrict the feeding areas for those species which require wet or muddy areas
    for feeding. In observing a short grass marsh area, it was seen that a direct relationship
    exists between moisture and habitat utilization.",nt"license_title": "License
